import React from 'react';

import { Box } from '@material-ui/core';

import { withKnobs } from '@storybook/addon-knobs';
import { array } from '@storybook/addon-knobs';

import * as utils from 'utils';
import { FilterBar } from 'components';

export default {
  title: 'FilterBar',
  component: FilterBar,
  decorators: [withKnobs],
};

export const Default = () => {
  const fields = [
    {
      gridSize: { xs: 12 },
      name: 'fullName',
      type: 'text',
      placeholder: utils.string.t('admin.searchByFullName'),
      value: '',
      muiComponentProps: {
        'data-testid': 'fullName',
      },
    },
  ];

  const actions = [
    {
      name: 'filter',
      label: utils.string.t('app.filter'),
      handler: (values) => {
        alert('Searched Field', { values });
      },
    },
    {
      name: 'reset',
      label: utils.string.t('app.reset'),
      handler: () => {
        alert('values reset');
      },
    },
  ];

  const fieldsObj = array('Fields', fields);
  const actionsObj = array('Action', actions);
  return (
    <Box>
      {' '}
      <FilterBar fields={fieldsObj} actions={actionsObj} />{' '}
    </Box>
  );
};
